function certificate(sap_id,first_name,middle_name, last_name,batch_name,certificate_no,group_name,trainee_id,test_data_id) {
		$(".batch").text(batch_name);
		$(".cert_no").text(certificate_no);
		$(".group_name").text(group_name);
		$(".sap_id").text(sap_id);
		$(".week").text("рекреж");
		$(".training_level_sh").text("ILKT");
		document.getElementById("profile_img").src = "";
		document.getElementById("signature_img").src = "";
		var img = $('#qrcode_' + sap_id + ',' +batch_name+ '').attr('src');
		document.getElementById("qrcode").src = img;
		var blank_pro_image = "";
		//pattern-wise date
		var today = new Date();
		var mm = today.getMonth() + 1;
		var dd = today.getDate();
		if (mm < 10) {
			mm = '0' + mm;
		}if (dd < 10) {
			dd = '0' + dd;
		}
		var date =dd + "." + mm + "." + today.getFullYear();
		$(".cer_issue_date").text(date);
		
		// fetching profile image from database and disaply it on certificate
		jQuery
				.ajax({
					url : "getStudentDetails?sap_id=" + sap_id,
					success : function(result) {
						if (result.profile_image != null
								&& result.profile_image != "") {
							document.getElementById("profile_img").src = "data:image/png;base64,"
									+ result.profile_image;
						} else {
							document.getElementById("profile_img").src = "data:image/png;base64,"
									+ blank_pro_image;
						}
						var name = result.first_name+" "+result.middle_name+" "+result.last_name;
						var str = name;
						str = str.toLowerCase().replace(/\b[a-z]/g, function(letter) {
						    return letter.toUpperCase();
						});
						$(".student_name").text(str);
					},
					global : false,
					async : false
				});
		
		// fetching form_date and to_date to display on certificate from new_trainee table
		jQuery
		.ajax({
			url : "getTraineeDetails?trainee_id=" + trainee_id,
			success : function(result) {
				var from_date = new Date(result.from_date);
				var to_date = new Date(result.to_date);
				
				var fromdate = from_date;
				var dd = ("0" + fromdate.getDate()).slice(-2);
				var mm = ("0" + (fromdate.getMonth() + 1)).slice(-2);
				var yyyy = fromdate.getFullYear();
				var fromdt = ""+dd + "/" + mm + "/" + yyyy;
				$(".fdate").text(fromdt);
				
				// formatted to date dd/mm/yyyy
				var today = to_date;
				var dd = ("0" + today.getDate()).slice(-2);
				var mm = ("0" + (today.getMonth() + 1)).slice(-2);
				var yyyy = today.getFullYear();
				var comp_date = ""+dd + "/" + mm + "/" + yyyy;
				$(".tdate").text(comp_date);
				$(".completion_date").text(comp_date);
				$(".training_level").text(result.level);
				/*$(".location").text(result.work_location);*/
				$(".location").text("Koradi Training Centre, Koradi");
				$(".cer_batch_name").text(result.short_batch_name);
				document.getElementById("signature_img").src = "data:image/png;base64,"
					+ result.signature;
			},
			global : false,
			async : false
		});
		
		//fetching percentage from dummy_test_data table to assign grade 
		jQuery.ajax({
			url : "getTraineePercentage?sap_id=" + sap_id + "&test_data_id="
					+ test_data_id,
			success : function(result) {
				if (result >=80) {
					$(".grade").text("Excellent");
				} else if (result >=70 && result <=79.99) {
					$(".grade").text("Very Good");
				} else if (result >= 60 && result <=69.99) {
					$(".grade").text("Good");
				} else {
					$(".grade").text("Average");
				}
			},
			global : false,
			async : false
		});
			
		//checking test status To generate certificate visibility (view/download)
		jQuery
		.ajax({
			url : "getTraineeTestStatus?sap_id=" + sap_id +"&test_data_id="+test_data_id,
			success : function(result) {
				if (result=="P") {
					alert("Your Test Is Pending.");
					$("#certificate_modal").modal("hide");
				} else if(result=="X" ){
					//alert("Your Test Is Pending.");
					$("#certificate_modal").modal("show");
					
				}else if(result=="D"){
					//alert("You Are Disqualified Please Contact Moderator");
					$("#certificate_modal").modal("show");
					
				}else if(result=="C"){
					//alert("You Are Disqualified Please Contact Moderator");
					$("#certificate_modal").modal("show");
					
				}else{
					$("#certificate_modal").modal("show");
					clickme();
				}
			},
			global : false,
			async : false
		});
		/*jQuery
		.ajax({
			url : "getAdminDetails",
			success : function(result) {
				if (result.signature != null
						&& result.signature != "") {
					document.getElementById("signature_img").src = "data:image/png;base64,"
							+ result.signature;
				}
			},
			global : false,
			async : false
		});*/
		
		$("#hidden_form_id").val(sap_id);
	}

