	function downloadCertificate(sap_id) {
		var pdf = new jsPDF('p', 'pt', 'a4','UTF-8', true);
		var img = new Image;
		var img_err = true;
		var profileImg = new Image;
		var signImg = new Image;
		var imgData = 'data:image/jpeg;base64,verylongbase64;'
		// page border image
		var border = 'data:image/png;base64,';
		var logo = 'data:image/png;base64,';

		source = $('#certificatepdf')[0];
		profileImg = $('#profile_img').attr('src');
		signImg = $('#signature_img').attr('src');
		var date = $("#date").text();
		var signature = $("#signature").text();
		var signature1 = $("#signature1").text();
		var completion_date = $(".completion_date").text();
		var traininglevel = $("#traininglevel").text();
		var cert = $("#cert").text();
		var qrimg = $('#qrcode_' + sap_id + '').attr('src');
		document.getElementById("qrcode").src = qrimg;
		specialElementHandlers = {

		};
		margins = {
			top : 180,
			bottom : 40,
			left : 60,
			right : 60,
			width : 470
		};
		pdf.addImage(border, 'png', 10, 10, 575, 820, '', 'FAST');
		pdf.addImage(logo, 'png', 250, 50, 100, 120);
		if ($('#profile_img').attr('src') != "") {
			try {
				img_err = false;
				pdf.addImage(profileImg, 'png', 455, 50, 80, 100);
				pdf.setFontSize(10);
				pdf.text(cert, -32, 50, null, null);

			} catch (err) {
				img_err = true;
				$("#errorText1").text(err.message);
				$("#errorBox1").show();
			}
		}
		
		if ($('#signature_img').attr('src') != "") {
			try {
				img_err = false;
				pdf.addImage(signImg, 'png', 380, 660, 90, 70);
			} catch (err) {
				img_err = true;
				$("#errorText1").text(err.message);
				$("#errorBox1").show();
			}
		}
		
		if (img_err) {
			pdf.setFontSize(10);
			pdf.text(cert, -32, 60, null, null);
			pdf.setFontSize(10);
			pdf.text(475, 80, 'Logo');
			pdf.text(478, 95, 'Not');
			pdf.text(465, 110, 'Available');
		}

		pdf.setFontSize(17);
		pdf.text(date, 60, 770, null, null);
		pdf.text(signature, 340, 750, null, null);
		pdf.text(signature1, 332, 770, null, null);
		pdf.text(completion_date, 110, 770, null, null);
		
		pdf.setFontSize(25);
		pdf.setTextColor(131,195,224);
		pdf.text(traininglevel,-50,300,null,null);
		//pdf.addImage(qrimg, 55, 130, null, null);
		pdf.addImage(qrimg, 55, 85, null, null);
		//pdf.text("рд╢реНрд░реЗрдгреА!", 50, 100,null, null);
		pdf.fromHTML(source, margins.left, margins.top, {
			'width' : margins.width,
			'elementHandlers' : specialElementHandlers
		}, function(dispose) {
			alert("Please Proceed OK to Start Download....")
			pdf.save('koradi_Training_certificate.pdf');
		});
	};

	$(".close").click(function() {
		$(".errorBox").hide();
	});


